import React, { useState } from 'react';
import {
  ReservationWrapper,
  BackgroundWrapper,
  DateSearchWrapper,
  Text,
  DateSearch,
} from './ReservationStyle';

interface reservationProps {
  date: string;
}
const Reservation: React.FC = () => {
  const [input, setInput] = useState('');
  const date: reservationProps = input;
  const onChange = (e: React.ChangeEvent<HTMLInputElement>) => {
    console.log(e.target.value);
    setInput(date);
  };
  return (
    <BackgroundWrapper>
      <ReservationWrapper>
        <DateSearchWrapper>
          <Text>날짜 검색하기</Text>
          <DateSearch
            placeholder="날짜 검색하기"
            onChange={onChange}
            value={date}
          />
        </DateSearchWrapper>
      </ReservationWrapper>
    </BackgroundWrapper>
  );
};

export default Reservation;
